      if (reader != null) {
        reorderedFields.add(reader);
        types.add(typesById.get(id));
      } else {
        reorderedFields.add(ParquetValueReaders.nulls());
        types.add(null);
      }
    }
  }

  return new InternalRowReader(types, reorderedFields);
}

